import SearchFitler from "../SearchFilter";
import PokemonBox from "./PokemonBox";

const tableabilities = {
    marginLeft: "400px",
    marginTop: "15px",
    marginRight: "100px",
}

class Pokemon extends React.Component {
    constructor(){
        super();
        this.state = {
            pokemon: []
        }
    }

    componentDidMount() {
        // fetch from mongodb

        fetch('http://localhost:5000/pokemon')
    }

    render() {
        return (
            <div className="App">
                <div className="container" style={tableabilities}>
                    <h1>Pokemon</h1>
                    <br/>
                    <br/>
                    <SearchFitler/>
                    <div className="row mt-5">
                        <PokemonBox id={1} name="Bulbasaur"/>
                        <PokemonBox id={2} name="Ivysaur"/>
                        <PokemonBox id={1} name="Bulbasaur"/>
                        <PokemonBox id={2} name="Ivysaur"/>
                    </div>
                </div>
            </div>

        );
    }
}

export default Pokemon;
